A spill-proof soy sauce cruet by Japanese brand 'THE', whose mission is to create products that can be considered as the epitome of an object. Re-imagined by designer Keita Suzuki, who came up with a new beak-like spout built into the cap, solving the spillage problem that is common with traditional soy sauce dispensers.

Both the bottle and the cap are made of non-lead crystal for its hygienic properties and visual clarity, making it possible to adjust the amount that pours out. The inner bottom base of the bottle is widely filleted for easy cleaning.

